/******************************************************************************
  Mux_Analog_Input
  SparkFun Multiplexer Analog Input Example
  Jim Lindblom @ SparkFun Electronics
  August 15, 2016
  https://github.com/sparkfun/74HC4051_8-Channel_Mux_Breakout
  This sketch demonstrates how to use the SparkFun Multiplexer
  Breakout - 8 Channel (74HC4051) to read eight, separate
  analog inputs, using just a single ADC channel.
  Hardware Hookup:
  Mux Breakout ----------- Arduino
     S0 ------------------- 2
     S1 ------------------- 3
     S2 ------------------- 4
     Z -------------------- A0
    VCC ------------------- 5V
    GND ------------------- GND
    (VEE should be connected to GND)
  The multiplexers independent I/O (Y0-Y7) can each be wired
  up to a potentiometer or any other analog signal-producing
  component.
  Development environment specifics:
  Arduino 1.6.9
  SparkFun Multiplexer Breakout - 8-Channel(74HC4051) v10
  (https://www.sparkfun.com/products/13906)
******************************************************************************/
/////////////////////
// Pin Definitions //
/////////////////////
#include <max6675.h>            // 溫度讀取庫

const int selectPins[3] = {4, 16, 17}; // S0~2, S1~3, S2~4
//const int zOutput = 5;
const int zInput = 33; // Connect common (Z) to A0 (analog input)

MAX6675* thermocouples[4];  // 溫度傳感器指標陣列
//MAX6675 thermocouple1(18, 33, 19);
MAX6675 thermocouple2(18, 32, 19);

void setup()
{
  Serial.begin(115200); // Initialize the serial port
  // Set up the select pins as outputs:

  pinMode(zInput, INPUT); // Set up Z as an input

  for (int i = 0; i < 3; i++)
  {
    pinMode(selectPins[i], OUTPUT);
    digitalWrite(selectPins[i], LOW);
  }


  for (int i = 0; i <= 3; i++) {
    thermocouples[i] = new MAX6675(18, zInput, 19);  // 初始化每個溫度傳感器
  }

  // Print the header:
  Serial.println("Y0\tY1\tY2\tY3\tY4\tY5\tY6\tY7");
  Serial.println("---\t---\t---\t---\t---\t---\t---\t---");
}

void loop()
{
  for (int i = 0; i <= 3; i ++) {
    //    Serial.print("Value");
    Serial.print(i);
    Serial.print("is : ");
    Serial.print(readMux(i));
    Serial.print("\t");
  }
  Serial.println();
  delay(1000);
}

// The selectMuxPin function sets the S0, S1, and S2 pins
// accordingly, given a pin from 0-7.
float readMux(int channel) {


  int muxChannel[8][3] = {
    {0, 0, 0}, //channel 0
    {1, 0, 0}, //channel 1
    {0, 1, 0}, //channel 2
    {1, 1, 0}, //channel 3
    {0, 0, 1}, //channel 4
    {1, 0, 1}, //channel 5
    {0, 1, 1}, //channel 6
    {1, 1, 1}, //channel 7
  };

  //    digitalWrite(zInput, LOW);
  delay(100);
  //loop through the 3 sig
  for (int i = 0; i < 3; i ++) {
    digitalWrite(selectPins[i], muxChannel[channel][i]);
  }

  //read the value at the Z pin
  float val = 0.0;
  if (channel <= 1) {
    delay(100);
    val = analogRead(zInput);  //光敏電阻
  }
  if (channel == 2) {
    delay(100);
    val = thermocouples[channel]->readCelsius();  // 讀取溫度
    //    val = thermocouple1.readCelsius();

  }
  if (channel == 3) {
    delay(100);
    //    val = thermocouples[channel]->readCelsius();  // 讀取溫度
    val = thermocouple2.readCelsius();

  }
  //    digitalWrite(zInput, HIGH);

  //return the value
  float voltage = val;
  return voltage;
}

