using namespace std;
const int N = 100;
int M[N][N];
int visited[N];

int eiler_check() {
    int count;
    for (int i = 1; i < N; i++) {
        count = 0;
        for (int j = 1; j < N; j++) {
            count += M[i][j];
        }
        if (count % 2 == 1) {
            //cout << "Граф не Эйлеровый" << endl;
            return 0;
        }
    } return 1;
}
int ribs_cheak(int* M) {
    int res = 0;
    for (int i = 1; i < N; i++) {
        if (M[i] == 1) {
            res++;
        }
    }
    if (res == 0) {
        return 0;
    }
    else return 1;
}
int eiler_path() {
    int v = 1;
    int i = v;
    int j = 1;
    int first = v;
    int last = 0;
    visited[j] = v;
    while (visited[1] == 1) {
        v = visited[j];
        for (int k = 1; k < N; k++) {
            if (ribs_cheak(M[v]) == 0) {
                if (last == 0) {
                    last = visited[j];
                }
                visited[j] = 0;
                j--;
                if (j == 0) {
                    break;
                }
            }
            if (M[v][k] == 1) {
                j++;
                i = k;
                visited[j] = k;
                M[v][k] = 0; M[k][v] = 0;
                break;
            }
        }
    }
    if (last == first) {
        return 1;
    }
    else return 2;
}
